/**
 * @description
 *
 * Interface que representa o token de identificação
 */
export interface ProAuthToken {
    access_token: string;
    refresh_token: string;
    scope: string;
    token_type: string;
    expires_in: number;
}
export interface ProAccessToken {
    iss: string;
    sub: string;
    iat: number;
    userid: string;
    exp: number;
    restrictedto: Array<string>;
}
